        "id": 13733952,
        "code": "ENTMQMAAS-382.1",
        "name": "Investigate options for enforcing backlog limits on broker/router.1",
        "projectKey": "ENTMQMAAS_3xxxx",
        "description": "ENTMQMAAS-348 and ENTMQMAAS-351 talk to setting limits on the broker to ensure that brokers respond appropriately in the event of being asked to store more (in memory or disk) than they are capable of doing.\r\n\r\nWe need to investigate what can be configured and enforced in the broker to cater both for whole broker level enforcement, and enforcement at the individual queue level; and from this information we can produce a design for ENTMQMAAS-348 and ENTMQMAAS-351\r\n\r\nUpstream issues: https://github.com/EnMasseProject/enmasse/issues/970 and https://github.com/EnMasseProject/enmasse/issues/967",
