        "name": "Document workaround for [#5297] : endpointStatuses.cert field missing from addressspace CRD.2",
        "projectKey": "ENTMQMAAS-2xxxx",
        "description": "The defect will mean that users who previously used the status.endpointStatus.cert field to obtain the trust material to connect to the AMQ Online will no longer be able to connect. This will affect users using self signed certs, so is unlikely for a production use-case. Such user can switch trusting CA cert available from status.caCert\r\n\r\nIt will only affect users on OpenShift 4. Users on OpenShift 4 who are using the bundle install option could patch the CRD like this:\r\n\r\n \r\n\r\n \r\n\r\n{{diff --git a/templates/crds/v1/addressspaces.crd.yaml b/templates/crds/v1/addressspaces.crd.yaml\r\nindex 9294307bb..e11dd5d67 100644\r\n--- a/templates/crds/v1/addressspaces.crd.yaml\r\n+++ b/templates/crds/v1/addressspaces.crd.yaml\r\n@@ -427,6 +427,8 @@ spec:\r\n                           type: object\r\n                           x-kubernetes-preserve-unknown-fields: true\r\n                         type: array\r\n+                      cert:\r\n+                        type: string\r\n                     type: object\r\n                   type: array\r\n                 isReady:}}",
